import { LucideIcon } from 'lucide-react';

export interface SidebarItem {
  label: string;
  href: string;
  icon: LucideIcon;
  isActive: boolean;
}

export interface NavigationItem {
  name: string;
  href?: string;
  icon: LucideIcon;
  submenu?: NavigationSubItem[];
}

export interface NavigationSubItem {
  name: string;
  href: string;
  icon: LucideIcon;
}

export type NavigationItems = NavigationItem[];
